import React from 'react';

const ResultPage = ({ data }) => {
  return (
    <div>
      <h2>최적화 결과</h2>
      <p>총 예상 비용: {data ? data.total_cost : 0} Gold</p>
    </div>
  );
};

export default ResultPage;
